import { Link } from "react-router-dom";
import { useContext, useEffect, useState } from "react";
import { UserContext } from "./components/UserContext";
import search_icon from "./assets/search-b.png";
import logo from './assets/favicon.ico';

export default function Header() {
  const { setUserInfo, userInfo } = useContext(UserContext);
  const [searchQuery, setSearchQuery] = useState("");

  useEffect(() => {
    fetch("http://localhost:4050/profile", {
      method: "GET",
      credentials: "include",
    }).then((response) => {
      response.json().then((userInfo) => {
        setUserInfo(userInfo);
      });
    });
  }, [setUserInfo]);

  function logout() {
    fetch("http://localhost:4050/logout", {
      credentials: "include",
      method: "POST",
    });
    setUserInfo(null);
  }

  const username = userInfo?.username;
  const role = userInfo?.role;

  return (
    <div>
      <header className="navbar">
        <div className="logoContainer">
          <img className="logoImage" src={logo} alt=""></img>
          <Link to="/" className="logo">
            AnalyzedByIITIANS
          </Link>
        </div>

        {/* Navigation Links */}
        <nav>
          <ul>
            <li><Link to="/">Home</Link></li>
            {username && (
              <>
                {role === "ADMIN" && (
                  <li><Link to="/create">Add new course</Link></li>
                )}
                <li><a href="/" onClick={logout}>Logout ({username})</a></li>
              </>
            )}
            {!username && (
              <>
                <li><Link to="/login">Login</Link></li>
                <li><Link to="/register">Register</Link></li>
              </>
            )}
          </ul>
        </nav>

        {/* Search Box */}
        <div className="search-box">
          <input
            className="search-bar"
            placeholder="Search..."
            value={searchQuery}
            onChange={(e) => setSearchQuery(e.target.value)}
          />
          {searchQuery ? (
            <Link to={`/search?query=${searchQuery}`}>
              <img src={search_icon} alt="Search Icon" className="search-icon" />
            </Link>
          ) : (
            <img src={search_icon} alt="Search Icon" className="search-icon" />
          )}
        </div>
      </header>

      {/* Footer Section */}
      <footer className="footer">
        <div className="footer-container">
          <div className="footer-section">
            <h3>About Us</h3>
            <p>AnalyzedByIITIANS is dedicated to providing top-notch courses and analysis for learners by IITians.</p>
          </div>
          <div className="footer-section">
            <h3>Quick Links</h3>
            <ul>
              <li><Link to="/">Home</Link></li>
              <li><Link to="/about">About Us</Link></li>
              <li><Link to="/contact">Contact</Link></li>
            </ul>
          </div>
          <div className="footer-section">
            <h3>Contact Us</h3>
            <p>Email: support@analyzedbyiitians.com</p>
            <p>Phone: +91-123-456-7890</p>
            <p>Address: IIT Campus, India</p>
          </div>
          <div className="footer-section">
            <h3>Follow Us</h3>
            <ul className="social-links">
              <li><a href="https://facebook.com" target="_blank" rel="noopener noreferrer">Facebook</a></li>
              <li><a href="https://twitter.com" target="_blank" rel="noopener noreferrer">Twitter</a></li>
              <li><a href="https://linkedin.com" target="_blank" rel="noopener noreferrer">LinkedIn</a></li>
            </ul>
          </div>
        </div>
        <div className="footer-bottom">
          <p>Â© 2025 AnalyzedByIITIANS. All Rights Reserved.</p>
        </div>
      </footer>
    </div>
  );
}
